    function css_supports(prop){ //css support checker
        var div = document.createElement('div'),
            vendors = 'Khtml O Moz Webkit'.split(' '),
            len = vendors.length;

        if ( prop in div.style ) return true;
        if ('-ms-' + prop in div.style) return true;
        prop = prop.replace(/^[a-z]/, function(val) {
            return val.toUpperCase();
        });
        while(len--) {
            if ( vendors[len] + prop in div.style ) {
            return true;
            }
        }
        return false;
    }

    function get_offset_matrix(x, y){ //get transform css
        var x = (typeof x === 'undefined') ? 0 : x,
            y = (typeof y === 'undefined') ? 0 : y;
        var val = 'matrix(1, 0, 0, 1,'+ x +', ' + y + ')';
        return {
            'transform'         : val
        }
    }

    function set_scroll_keyframe($item){
        var x = $item.data('offset-x') || 0,
            y = $item.data('offset-y') || 0,
            css_start = $item.data('animation-start') || '',
            css_end = $item.data('animation-end') || '',
            base = $item.data('offset-base')||0,
            base_end = $item.data('offset-end'),
            is_fade = $item.data('fade')||false,
            is_emit_events = $item.data('emit-events'),
            is_move = $item.data('offset-move') !== false;
        var attr = {};
        var t = y;

        if(!base) base = 0;
        t = typeof base_end !== 'undefined' ? base_end : base - Math.abs(y);
        if(!x) x = 0;
        var start = base ? 'data-'+base+'-bottom' : 'data-bottom';
        var end = 'data-' + t + '-bottom';
        attr[start] = '';
        attr[end] = '';
        if(!transform_effect_support) {
            if(is_move) {
                attr[start] = 'margin-top: ' + y + 'px;';
                attr[end] = 'margin-top: 0px;';
            }
            if(x) {
                attr[start] += 'margin-left: ' + x + 'px;';
                attr[end] += 'margin-left: 0px;';
            }
        } else {
            if (!is_move) {
                y = 0;
            }
            attr[start] = "transform: " +get_offset_matrix(x, y)['transform']+';';
            attr[end] = "transform: " + get_offset_matrix(0, 0)['transform']+';';
        }
        if(is_fade) {
            attr[start] += 'opacity: 0;';
            attr[end] += "opacity: 1;";
        }
        attr[start] += css_start;
        attr[end] += css_end;
        if(is_emit_events) {
            attr['data-emit-key'] = 'data'+t+'Bottom';
        }
        return attr;
    }

    function init_animate($item) {
        var data = $item.data();
        var arrs = data['animateData'];
        if(ie6) return false;
        if($.isEmptyObject(arrs)) return false;
        var obj, default_data = {'duration': 500, 'delay': 0, 'effect': 'linear'};
        if($.isArray(arrs)) {
            arrs = {"default": {action: arrs} };
        } else{
            if(typeof arrs['default'] === 'undefined') {
                arrs = {"default": {action: [arrs]} }
            }
        }
        for(var i in arrs) {
            var arr = arrs[i];
            if($.isArray(arr)) arrs[i] = {action: arr};
            else{
                if(typeof arr['action'] === 'undefined') {
                    arrs[i] = {action: [arr]};
                } else if( !$.isArray(arr['action']) ){
                    arrs[i]['action'] = [ arr['action'] ]
                }
            }
            arr = arrs[i];
            if(typeof arr['reset'] === 'undefined') {
                arr['reset'] = {};
            }
            var opt = [], p1 = arr['reset'];
            for(var j in arr.action) {
                var obj = arr['action'][j];
                var p2 = {};
                for(var key in obj) {
                    if( key == 'offsetTop' || key == 'offsetLeft' ) {
                        if(!!obj[key]) {
                            var k = 'margin-' + key.toLowerCase().replace('offset', '');
                            var n = parseInt($item.css(k));
                            if( typeof p1[k] === 'undefined' ) p1[k] = n;
                            else n = parseInt(p1[k]);
                            p2[k] = n + obj[key];
                        }
                    } else {
                        if( typeof p1[key] === 'undefined' ) p1[key] = $item.css(key);
                        p2[key] = obj[key];
                    }
                }
                opt.push(p2);
            }
            for(var i in opt) {
                opt[i] = $.extend({}, p1, opt[i]);
            }
            arr.action = opt;
        }
        if(typeof arrs['default'] === 'undefined' ) {
            arrs['default'] = {'reset': {}, 'action': []};
        }
        $.extend(default_data, {'animateOptions': arrs});
        obj = $.extend({}, default_data, data);
        $item.data(obj);
    }

    function play_animate($item, index, callback) {
        var data = $item.data();
        if(typeof index == 'undefined') index = 0;
        if(typeof data['animateOptions'] === 'undefined') return false;
        var opts = data['animateOptions'];
            opts = opts['default']['action'];
        if(opts.length < 1 || opts.length <= index ) return false;
        opts = opts[index];
        if($.isEmptyObject(opts)) return false;
        $item.clearQueue().stop().delay(data['delay']).animate(opts, data['duration'], data['effect'], function(){
            if($.isFunction(callback)){
                callback();
            }
        });
    }
    function reset_animate($item, callback) {
        var data = $item.data();
        if(typeof index == 'undefined') index = 0;
        if(typeof data['animateOptions'] === 'undefined') return false;
        var opts = data['animateOptions'];
            opts = opts['default']['reset'];

        if($.isEmptyObject(opts)) return false;
        $item.clearQueue().stop().animate(opts, data['duration'], data['effect'], function(){
            if($.isFunction(callback)){
                callback();
            }
        });
    }

